  false,\n\t\"url\": null,\n\t\"notes\": \"This Fire Management Plan outlines and
  details all of the refuge objectives for prescribed burns for the 1991 calendar
  year. It includes new fire management objectives not included in the 1990 Refuge
  Fire Management Plan, such as the use of prescribed fires for wildlife habitat restoration
  and enhancement, and support of wildlife research, where applicable. It will help
  achieve resource management objectives as defined in the Patuxent Research Refuge
  Master Plan, including objectives of the Refuge Forest Management Plan, Grassland
  Management Plan, Endangered Species Management Plan, Migratory Bird Management Plans,
  and Exotic Species Management Plan.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
